// Dashboard.tsx

import React from "react";
import MedicalSchedule from "./MedicalSchedule";
import OnlineScheduling from "./OnlineScheduling";
import DailyPatientList from "./DailyPatientList";

const Dashboard: React.FC = () => {
  return (
    <div>
      <h1>Dashboard</h1>
      <div>
        <MedicalSchedule />
      </div>
      <div>
        <OnlineScheduling />
      </div>
      <div>
        <DailyPatientList />
      </div>
    </div>
  );
};

export default Dashboard;
